def solve(board):

    m, n = len(board[0]), len(board)

    passed = []
    for x in range(1, m-1):
        for y in range(1, n-1):
            if board[y][x] == 'X' or (x, y) in passed:
                continue
            idx, keep = 0, False
            stack = [(x, y)]
            while idx < len(stack):
                print(idx)
                for (i, j) in [(-1,0), (0,-1), (1,0), (0,1)]:
                    x_loc, y_loc = stack[idx][0]+i, stack[idx][1]+j
                    
                    if not (0 <= x_loc <= m - 1) or not (0 <= y_loc <= n - 1):
                        continue
                    if (x_loc, y_loc) in stack:
                        continue
                    if board[y_loc][x_loc] == 'O':
                        stack.append((x_loc, y_loc))
                    
                        if x_loc in (0, m-1) or y_loc in (0, n-1):
                            keep = True
                idx += 1
            passed.extend(stack)
            if keep:
                continue
            for (x_loc, y_loc) in stack:
                board[y_loc][x_loc] = 'X'
    return


def solve(board):

    m, n = len(board[0]), len(board)

    middle = []
    for x in range(1, m-1):
        for y in range(1, n-1):
            middle.append((x, y))

    list(zip([0]*n + [0]*m + list(range(m)) + list(range(n)), list(range(m)) + list(range(n)) + [n-1]*n + [m-1]*m))

    passed = []
    lst_x = list(zip(list(range(m)) + list(range(m)), [0]*m + [n-1]*m))
    lst_y = list(zip([0]*n + [m-1]*n, list(range(n)) + list(range(n))))
    for (x, y) in lst_x + lst_y:
        if board[y][x] == 'X' or (x, y) in passed:
            continue
        idx, keep = 0, False
        stack = [(x, y)]
        while idx < len(stack):
            print(idx)
            for (i, j) in [(-1,0), (0,-1), (1,0), (0,1)]:
                x_loc, y_loc = stack[idx][0]+i, stack[idx][1]+j
                
                if not (0 <= x_loc <= m - 1) or not (0 <= y_loc <= n - 1):
                    continue
                if (x_loc, y_loc) in stack:
                    continue
                if board[y_loc][x_loc] == 'O':
                    stack.append((x_loc, y_loc))
                
                    if x_loc in (0, m-1) or y_loc in (0, n-1):
                        keep = True
            idx += 1
        passed.extend(stack)
        if keep:
            continue

    for x, y in middle:
        if (x, y) not in passed:
            board[y][x] = 'X'

    return


